        public class TradeWithDateConverter
        {
            public long? Id { get; set; }
            public double? Price { get; set; }
            public double? Quantity { get; set; }
            public string Name { get; set; }
            [ChoTypeConverter(typeof(ChoDateTimeOffsetConverter))]
